import data from "./datas/Users.js"
function ChildItem({ capital,state, language }) {
    return (
      <div className="project-item">
        <h3>{capital}</h3>
        <p>{state}</p>
        <div className="technologies">
          {/* render a <span> for each technology in the technologies array */}
          {language.map((onelang) => (
            <span key={onelang}> {onelang}</span>
          ))}
        </div>
      </div>
    );
  }


  export default ChildItem;
